measurements.description:
Twenty-four flowers and five buds on four upright up to 45-cm inflorescences;
	sepals light green, veined burgundy, infused burgundy concentrated distally; petals light green veined burgundy;
	lip curled distally, cream, horizontal burgundy barring, side lobes cream, burgundy margins;	

	column light green overlaid and marked burgundy, anther cap yellow;


    substance firm; texture waxy; sepals appear much darker under photography lights than away from them.
